import React from 'react';
import './home.css';
import * as firebase from 'firebase';


import LoginDone from './logindone';
import Login from './login';

import 'firebase/auth';

class Logincheck extends React.Component
{
  constructor(props) {
    super(props);

    this.state = {
      status: []
    };
  }

  componentDidMount() {

    let newState = [];
    firebase.auth().onAuthStateChanged(user => {

         if (user)
         {
           this.setState({
             status: <LoginDone />
           });
         }
         else
         {
           this.setState({
             status: <Login />
           });
         }
     });
    }





render()
{

  return(

    <div className = "maindiv">

        <a onClick="" className = "signup">Sign up</a>
        <a onClick="" className = "signup">Sign in</a>

        <div>
            {this.state.status}
        </div>
        
    </div>

);
}


}

export default Logincheck;
